window.bookSummaryJSON = "<p>Jonah Rowe knew that he didn't know everything about his abilities as an 11th Percenter - a human who could access the power of their auras. But he knew enough to not believe in the myths of the Greek Gods.</p> <p>Those were stories for kids. Hollywood.</p> <p>Until the Sibyl came along.</p> <p>Eva McRayne wanted nothing more than to get back to her Hollywood life after a senseless tragedy derailed it. So, when she and her film crew went to Rome, North Carolina, to film an episode for her show <i>Grave Messages</i>, she had no idea that she was walking straight into a trap.</p> <p>One that only Jonah Rowe could help her escape from.</p>"; 
